import React from 'react';
import {useSelector} from 'react-redux';
import AppLayout from '../components/AppLayout';
import { FormProvider } from 'antd/lib/form/context';

const Home = () => {
	const {isLoggedIn} = useSelector((state)=>state.user)
	return (
		<AppLayout>
			<PostForm />
		</AppLayout>
	)
}

export default Home;
